import './Skills.css';

function Skills(){
    return(
        <div className='skills-wrapper'>
            <section>
                <div className='skills-header'>
                    <hr></hr>
                    <h1>Skills</h1>
                </div>
                <div className='skills-content'>
                    <div className='skills-img'></div>
                    <h1>What are my capabilities?</h1>
                </div>
            </section>
        </div>
    );
}
export default Skills
